package OperatorsJava;

public class RelaionalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int p=10,q=15;
		System.out.println(p==q);
		System.out.println(p!=q);
		System.out.println(p<=q);
		System.out.println(p>=q);
		System.out.println(p<q);
		System.out.println(p>q);

	}

}
